// import React from "react"
import ReactDOM from "react-dom/client"
import "./style.css"




const root = ReactDOM.createRoot(document.getElementById("root"))


//navbar component
function Navbar() {
  return (
    <nav>
      <h1>Perfumy</h1>
      <ul>
        <li>Home |</li>
        <li>Product |</li>
        <li>About |</li>
        <li>Contact |</li>

      </ul>
    </nav>

  )
}

//search components

function Search() {
  return (
    <div className="Search">
      <input type="text" placeholder="search" />

    </div>
  )
}



//products components
function Products() {
  return (
    <div className="products">

      <div className="box">
        <img src="./images/one.jpg" alt="hero" />
        <p>Fogg Wood Extreme, Eau De Parfum, Long-lasting Perfume, 100ml</p>
      </div>

      <div className="box">
        <img src="./images/two.jpg" alt="villain" />
        <p>Fogg Wood Extreme, Eau De Parfum, Long-lasting Perfume, 100ml</p>
      </div>

      <div className="box">
        <img src="./images/three.jpg" alt="Designs Club" />
        <p>Designer Club-Be Spoke by Perfume Lounge Men's Perfume | Premium Long Lasting Perfume</p>
      </div>

    </div>

  )
}

//about component

function About(){
  return(
    <div className="About">
      <h1>About Us</h1>
      <p>Lorem ipsum, dolor sit amet consectetur adipisicing elit. Neque sapiente atque illum autem dolorem corrupti, similique est consectetur necessitatibus. Nisi numquam non veniam architecto blanditiis? Sunt earum ex tempore aliquam inventore, nihil molestiae. Earum eos delectus explicabo. Atque quod illum nemo, quo sapiente consequatur alias eligendi earum rerum id quas.</p>
    </div>
  )
}

//footer component

function Footer(){
  return(
    <div className="footer">
      <h2>Contact</h2>
      <p>+91 </p>
    </div>  )
}

root.render(
  <div>
    <Navbar />
    <Search />
    <Products />
    <About/>
  </div>


)
